import { useNavigate } from "react-router-dom";
import logo from "../images/bc-logo-white.png"
import classes from "../styles/Footer.module.css";

export default function Footer() {
  // const navigate = useNavigate();

  return(
    <div>
      <div className={classes.footer}>
        <div className="col-1" >
          <img src={logo}/>
        </div>
        <div className="col-2">
          <p className="footer-title">Braving Counseling with Vicki, LLC</p>
          <p className="address roboto-regular">115 NE 7th Ave, Suite 103; Gainesville, FL 32601</p>
          {/* <p className="address roboto-regular"></p> */}
          <p className="email handlee-regular"><i class="fa-regular fa-envelope" /> vicki@fakeemail.com</p>
          <p className="phone handlee-regular"><i class="fa-solid fa-mobile-screen" /> (352) 290-2038</p>
        </div>
        <div className="col-3"></div>
      </div>
    </div>
  )
}
